INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 110501, 4, 4, 0.0, 10021, "カオリ（サマー）", 1, "2030/12/17 14:59:59", 24015);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 110501, 4, 1, 4.0, 10021, "カオリ（サマー）", 2, "2030/12/17 14:59:59", 24016);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 110501, 4, 4, 0.0, 10021, "カオリ（サマー）", 3, "2030/12/17 14:59:59", 24017);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 110501, 1, 2, 5.2, 10021, "カオリ（サマー）", 4, "2030/12/17 14:59:59", 24018);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 110501, 5, 6, 4.2, 10021, "カオリ（サマー）", 5, "2030/12/17 14:59:59", 24019);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 110501, 2, 2, 0.0, 10021, "カオリ（サマー）", 6, "2030/12/17 14:59:59", 24020);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 110501, 1, 6, 6.4, 10021, "カオリ（サマー）", 7, "2030/12/17 14:59:59", 24021);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 110501, 2, 2, 0.0, 10021, "カオリ（サマー）", 8, "2030/12/17 14:59:59", 24022);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 110501, 6, 3, 10.08, 10021, "カオリ（サマー）", 9, "2030/12/17 14:59:59", 24023);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 110501, 1, 2, 5.0, 10021, "カオリ（サマー）", 10, "2030/12/17 14:59:59", 24024);
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24, 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 110501, 2, 2, 0.0, 10021, "カオリ（サマー）", 11, "2030/12/17 14:59:59", 24025);
